window.bookSummaryJSON = "<p><b><i>Monster. Liar. Thief. Killer.</i></b></p> <p><b><i>I’ve been called it all and so much worse.</i></b></p> <p><b><i>And they’re not wrong.</i></b></p> <p>I’ve been running my whole life. Hiding from the monsters who haunt my dreams and who will tear me apart again and again if they ever find me. I live off whatever I can steal, trapped inside a fae prison city filled with pollution, sin and poverty. Humans have captured the Fae.</p> <p>We belong to them now.</p> <p>My scars make me a bad omen to my people, who shun and torment me at every turn.</p> <p>Cyrus, the egotistical and frustratingly gorgeous leader of the fae under-city, can’t seem to decide whether he wants to kill me or claim me for his own dark and delicious desires.</p> <p>And Reid, a dangerous and hypnotically beautiful human Authority Agent whose sole purpose should be to keep me in the dirt, has decided to keep me as his own personal Pet instead.</p> <p>But when dark, demonic creatures start attacking, killing human and Fae alike, alliances must be made, especially when the monsters seem to be determined to find and slaughter me.</p> <p>A dormant war is awakening, and the part I must play in it is only just becoming clear.</p> <p>Do I stand and fight? Or do I strike the match and watch them all burn?</p> <p><b><i>Lies of the Fae is book 1 in “The Stolen Fae series”. It’s a dark, urban-fantasy romance full of magic, danger, passion, and pain. </i></b></p> <p><i>*Please Note: This is a dark MFM romance book and contains explicit content and darker elements. It is not intended for anyone under 18 years of age. For full list of triggers, please check the author's website.</i></p>"; 
